import { Link } from "react-router-dom";
import AllProductCSS from "../css/AllProductCSS.css";
import ProductData from "../data/products.json";

const ProductList = (product, i) => {
  return (
    <div
    // key={props.products[i].id}
    className="productlist-container">
      {/* <Link to={`/${props.id}`}> */}
        <div className="single-container">
          <h3 className="product-name">{product.products[i].name}</h3>
          <img className="product-image" src={product.products.image} alt="this product" />
          <div className="product-desc">
            <p className="description">{product.description}</p>
            <p className="product-price">{product.price}</p>
          </div>
        </div>
      {/* </Link> */}
    </div>
  );
};

export default ProductList;
